import React, { useState, useEffect } from 'react';
import { createUser, getUsers } from './services/api.js';
import './App.css'; // Ensure this file exists and is correctly referenced

const App = () => {
    const [users, setUsers] = useState([]);
    const [income, setIncome] = useState('');
    const [creditScore, setCreditScore] = useState('');
    const [employmentStatus, setEmploymentStatus] = useState('');
    const [loanAmount, setLoanAmount] = useState('');
    const [loanTerm, setLoanTerm] = useState('');

    useEffect(() => {
        fetchUsers();
    }, []);

    const fetchUsers = async () => {
        try {
            const data = await getUsers();
            setUsers(data);
        } catch (error) {
            console.error('Error fetching users:', error);
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        const user = {
            income,
            creditScore,
            employmentStatus,
            loanAmount,
            loanTerm,
        };
        try {
            await createUser(user);
            fetchUsers(); // Refresh the user list
        } catch (error) {
            console.error('Error creating user:', error);
        }
    };

    return (
        <div>
            <h1>Banking Services Platform</h1>
            <form onSubmit={handleSubmit}>
                <input type="text" placeholder="Income" value={income} onChange={(e) => setIncome(e.target.value)} />
                <input type="text" placeholder="Credit Score" value={creditScore} onChange={(e) => setCreditScore(e.target.value)} />
                <input type="text" placeholder="Employment Status" value={employmentStatus} onChange={(e) => setEmploymentStatus(e.target.value)} />
                <input type="text" placeholder="Loan Amount" value={loanAmount} onChange={(e) => setLoanAmount(e.target.value)} />
                <input type="text" placeholder="Loan Term" value={loanTerm} onChange={(e) => setLoanTerm(e.target.value)} />
                <button type="submit">Submit</button>
            </form>
            <h2>Users</h2>
            <ul>
                {users && users.map((user, index) => (
                    <li key={index}>
                        {`Income: ${user.income}, Credit Score: ${user.creditScore}, Employment Status: ${user.employmentStatus}, Loan Amount: ${user.loanAmount}, Loan Term: ${user.loanTerm}`}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default App;
